CREATE DEFINER=`root`@`localhost` PROCEDURE `InsufficientStock` (IN `myIdClient` INT, IN `myIdProduct` INT, IN `myUnits` INT, IN `myStock` INT, INOUT `customerInvoiceNumber` VARCHAR(12), INOUT `myOrderLine` INT, INOUT `message` VARCHAR(2000))  NO SQL
