        ELSE SET myIdShoppingCart = (SELECT `idShoppingCart` FROM `shopping_cart` WHERE `idClient` = myIdClient AND `idProduct` = myIdProduct);
         SET message = concat(message," - ", addShoppingCartHistoric(myIdClient, myIdProduct, myStock, myIdShoppingCart, "VP"));
       IF locate("Error", message) THEN ROLLBACK;
                  ELSE SET message = concat(message," - ", updateShoppingCart_unit(myIdClient, myIdProduct, (myUnits - myStock), false));
                    IF locate("Error", message) THEN ROLLBACK;   
                       		ELSE SET  message = concat(message," - ", addDetail_line_bill_client(customerInvoiceNumber, myOrderLine, myIdProduct, myStock));
    		 					IF locate("Error", message) THEN ROLLBACK;     
             						ELSE SET myOrderLine = myOrderLine + 1;
                  						 COMMIT;
            					 END IF;
                    END IF;   
              END IF;
			 
END IF;

END$$

