CREATE DEFINER=`root`@`localhost` PROCEDURE `ManageThePurchase` (IN `myIdClient` INT, OUT `message` VARCHAR(2000))  NO SQL
BEGIN

DECLARE finished boolean DEFAULT false;
DECLARE myIdProduct int DEFAULT 0;
DECLARE myUnits int DEFAULT 0;
DECLARE customerInvoiceNumber varchar(12) DEFAULT "";
DECLARE myOrderLine int DEFAULT 1;
DECLARE myStock int DEFAULT 0;
DECLARE myIdShoppingCart int DEFAULT 0;
DECLARE response boolean DEFAULT false;
DECLARE headerAdded boolean DEFAULT false;

DECLARE cursor_buy_cart CURSOR FOR  SELECT `idProduct`,`units` FROM `shopping_cart` WHERE `idClient` = myIdClient;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = true;

SET message = "Comienzo:";

OPEN cursor_buy_cart;
FETCH cursor_buy_cart  INTO myIdProduct, myUnits;

IF (myIdProduct > 0) THEN
	CALL AddHeaderBillClient(myIdClient, customerInvoiceNumber, headerAdded, message);                      
END IF;
  
WHILE !finished AND headerAdded DO
	SET myStock = getStock(myIdProduct);
    IF (myStock >= myUnits) THEN CALL SufficientStock(myIdClient, myIdProduct, myUnits, customerInvoiceNumber, myOrderLine, message);
    ELSE IF (myStock > 0 AND (myStock < myUnits)) THEN CALL InsufficientStock(myIdClient, myIdProduct, myUnits, myStock, customerInvoiceNumber, myOrderLine, message);
    	
        	ELSE SET message = concat(message," - Del IdPro:", myIdProduct, "NO hay existencias ");
                 SET myIdShoppingCart = (SELECT `idShoppingCart` FROM `shopping_cart` WHERE `idClient` = myIdClient AND `idProduct` = myIdProduct);
                 SET message = concat(message,  addShoppingCartHistoric(myIdClient, myIdProduct, myUnits, myIdShoppingCart, "VA"));
         END IF;
    
    END IF;
   
   SET message = concat(message," IdPro:", myIdProduct, " Units: " , myUnits);
   
  FETCH cursor_buy_cart  INTO myIdProduct, myUnits;
END WHILE;
CLOSE cursor_buy_cart ;
SET message = manageThePurchaseFinish( myOrderLine, headerAdded, customerInvoiceNumber, message);
END$$

