        ELSE SET myIdShoppingCart = (SELECT `idShoppingCart` FROM `shopping_cart` WHERE `idClient` = myIdClient AND `idProduct` = myIdProduct);
             SET message = concat(message," - ", addShoppingCartHistoric(myIdClient, myIdProduct, myUnits, myIdShoppingCart, "VC"));
             IF locate("Error", message) THEN ROLLBACK;
                  ELSE SET message = concat(message," - ", deleteShoppingCart(myIdClient, myIdProduct, false));
