CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateOrderFromBillProvider` (IN `myIdRowHBP` INT, IN `myConcept` VARCHAR(200), IN `myMemory` VARCHAR(30), IN `myMemoryIn` VARCHAR(30), IN `myColor` VARCHAR(50), IN `myUnitsReceived` INT, IN `myPrice` FLOAT, INOUT `message` VARCHAR(2000))  NO SQL
BEGIN

DECLARE myUnitsOrder int DEFAULT  getOrderedUnits(myIdRowHBP, myConcept, myMemory, myMemoryIn, myColor);

START TRANSACTION;

 
 IF myUnitsOrder > 0 THEN  START TRANSACTION;   
       SET message = concat(message, addProviderOrderedHistoric(myIdRowHBP, myConcept, myMemory, myMemoryIn, myColor,  myUnitsOrder, myUnitsReceived, myPrice));
       IF (myUnitsOrder = myUnitsReceived) THEN
           CALL ValueTransaction(updateProviderOrdered_removedTrue(myIdRowHBP, myConcept, myMemory, myMemoryIn, myColor), message);    	   
        ELSE  CALL ValueTransaction(updateProviderOrdered_idRowHBP_unitsOrdered_isReceived(myIdRowHBP, myConcept, myMemory, myMemoryIn, myColor, myUnitsReceived), message);

	   END IF;    
  ELSE
  SET message = concat(message," - There is nothing requested :",myConcept,"-",myMemory,"-",myMemoryIn,"-",myColor);

END IF;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateSalesAndOrderFromBillProvider` (IN `myIdRowHBP` INT, INOUT `message` VARCHAR(2000))  NO SQL
BEGIN
DECLARE finished boolean DEFAULT false;
DECLARE myConcept varchar(200) DEFAULT "";
DECLARE myMemory varchar(20) DEFAULT "";
DECLARE myMemoryIn varchar(30) DEFAULT "";
DECLARE myColor varchar(50) DEFAULT "";
DECLARE myUnits int DEFAULT 0;
DECLARE myPrice float DEFAULT 0.0;
DECLARE myIdProduct int DEFAULT 0;

DECLARE cursor_bill CURSOR FOR SELECT `concept`, `memory`,`memoryIn`,`color`,`units`,`price`  FROM `idrowhbp_bill` WHERE `idRowHBP` = myIdRowHBP;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = true;

OPEN cursor_bill;

FETCH cursor_bill INTO myConcept, myMemory, myMemoryIn,  myColor, myUnits, myPrice;

WHILE !finished DO	
 	CALL UpdateSalesFromBillProvider(myIdRowHBP, myConcept, myMemory, myMemoryIn, myColor, myUnits, myPrice, message);
	CALL UpdateOrderFromBillProvider(myIdRowHBP, myConcept, myMemory, myMemoryIn, myColor, myUnits, myPrice, message);     
	 FETCH cursor_bill INTO myConcept, myMemory, myMemoryIn,  myColor, myUnits, myPrice;
END WHILE;
CLOSE cursor_bill;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateSalesFromBillProvider` (IN `myIdRowHBP` INT, IN `myConcept` VARCHAR(200), IN `myMemory` VARCHAR(30), IN `myMemoryIn` VARCHAR(30), IN `myColor` VARCHAR(50), IN `myUnits` INT, IN `myPrice` FLOAT, INOUT `message` VARCHAR(2000))  NO SQL
