CREATE DEFINER=`root`@`localhost` FUNCTION `addDetail_line_bill_client` (`myIdNumberBill` VARCHAR(12), `myOrderLine` INT, `myIdProduct` INT, `myUnits` INT) RETURNS VARCHAR(100) CHARSET utf8 COLLATE utf8_unicode_ci NO SQL
BEGIN

DECLARE myPrice float DEFAULT (SELECT `salePrice` FROM `shop_product` WHERE `idProduct` = myIdProduct);
DECLARE myDiscountBonus float DEFAULT (SELECT `discountBonus` FROM `shop_product` WHERE `idProduct` = myIdProduct);
DECLARE myPercentageDiscount float DEFAULT  (SELECT `percentageDiscount` FROM `shop_product` WHERE `idProduct` = myIdProduct);
DECLARE myNetAmount float DEFAULT myUnits * myPrice;
DECLARE myIva float DEFAULT 21;
DECLARE myIvaAmount float DEFAULT myNetAmount * (myIva / 100);
DECLARE myModelAmount float DEFAULT myNetAmount + myIvaAmount;

IF myDiscountBonus > 0 THEN SET myNetAmount = myNetAmount - (myUnits * myDiscountBonus);
END IF;
IF myPercentageDiscount > 0 THEN SET myNetAmount = myNetAmount - (myNetAmount * (myPercentageDiscount / 100));
END IF;
 

,  `netAmount`,`iva`, `ivaAmount`, `modelAmount`) VALUES(
myIdNumberBill, myOrderLine,
    (SELECT `modelName`  FROM `model` WHERE `referencia_sku` = (SELECT `referencia_sku` FROM `shop_product` WHERE `idProduct` = myIdProduct)),
