CREATE DEFINER=`root`@`localhost` FUNCTION `fillZerosOnTheLeft` (`cadena` VARCHAR(20), `count` INT) RETURNS VARCHAR(20) CHARSET utf8 COLLATE utf8_unicode_ci NO SQL
BEGIN

DECLARE size int DEFAULT char_length(cadena);


WHILE  (size < count)  DO

	SET cadena = concat("0",cadena);
    SET size = size + 1;
   
END WHILE;

RETURN cadena;


END$$

