CREATE DEFINER=`root`@`localhost` FUNCTION `getNewSKU` (`InidBrand` INT, `InModelName` VARCHAR(200)) RETURNS VARCHAR(30) CHARSET utf8 COLLATE utf8_unicode_ci NO SQL
