CREATE DEFINER=`root`@`localhost` FUNCTION `isStringLetter` (`myString` VARCHAR(200)) RETURNS TINYINT(1) NO SQL
BEGIN

DECLARE contadorLetra int DEFAULT 0;
DECLARE limite int DEFAULT char_length(myString);

WHILE contadorLetra < limite DO
    
    SET contadorLetra = contadorLetra + 1;
  IF  !isLetter(mid(myString,contadorLetra,1)) THEN RETURN false;
  END IF;
  
END WHILE;

RETURN contadorLetra;





END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `isStringLettersSpace` (`myString` VARCHAR(200)) RETURNS TINYINT(1) NO SQL
BEGIN

DECLARE contadorLetra int DEFAULT 0;
DECLARE limite int DEFAULT char_length(myString);
DECLARE letter varchar(1) DEFAULT "";

WHILE contadorLetra < limite DO    
    SET contadorLetra = contadorLetra + 1;
    SET letter = mid(myString,contadorLetra,1);
  IF  !isLetter(letter) && letter != " "THEN RETURN false;
  END IF;
  
END WHILE;

RETURN contadorLetra;





END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `isStringLettersSpaceGuidon` (`myString` VARCHAR(200)) RETURNS TINYINT(1) NO SQL
BEGIN

DECLARE contadorLetra int DEFAULT 0;
DECLARE limite int DEFAULT char_length(myString);
DECLARE letter varchar(1) DEFAULT "";

WHILE contadorLetra < limite DO    
    SET contadorLetra = contadorLetra + 1;
    SET letter = mid(myString,contadorLetra,1);
  IF  !isLetter(letter) && letter != " " && letter != "-" THEN RETURN false;
  END IF;
  
END WHILE;

RETURN contadorLetra;


END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `isStringNumber` (`myString` VARCHAR(5)) RETURNS TINYINT(1) NO SQL
BEGIN

DECLARE len int DEFAULT CHAR_LENGTH(myString);
DECLARE i int DEFAULT 0;

WHILE i < len DO
    SET i = i + 1;
    if mid(myString,i,1) NOT BETWEEN "0" AND "9" THEN RETURN false;
    END IF;
END WHILE;

RETURN true;
END$$

