--
-- Disparadores `shop_product`
--
DELIMITER $$
CREATE TRIGGER `shop_product_BU` BEFORE UPDATE ON `shop_product` FOR EACH ROW BEGIN

IF ((new.stockCurrent < new.stockMinimum) AND !isInProvider_ordered(new.idProvider, new.idProduct)) THEN 

      VALUES (new.idProvider,
              new.idProduct,
              new.referencia_sku,
              (SELECT `modelName` FROM `model` WHERE `referencia_sku` = new.referencia_sku),
              (SELECT `modelDescription` FROM `model` WHERE `referencia_sku` = new.referencia_sku),
              (SELECT `modelFeatures` FROM `model` WHERE `referencia_sku` = new.referencia_sku), 
              new.memory,
              new.memoryIn,
              new.color,
              new.salePrice,
              new.stockMinimum*2);
	END IF;
    

END
$$
DELIMITER ;

