INSERT INTO `model` (`referencia_sku`, `modelName`, `modelDescription`, `modelFeatures`, `imageModel`, `imageRear`, `imageSide`, `idBrand`, `SO`, `versionSO`, `weight`, `cpuSpeed`, `iva`, `webCharacteristic`) VALUES
('APP-594-APP', 'APPLE IPHONE 11 64GB RED', 'PN: MWLV2QL/A EAN: 190199221871\r\nLIQUID RETINA HD / A13 BIONIC / LTE / DUAL 12MPX / 4K / 6,1\"', 'Un nuevo sistema de cámara dual que abarca un campo de visión más amplio. El chip más rápido que haya tenido un smart­phone hasta la fecha. Una batería que dura todo el día, para que hagas más y cargues menos. Y el vídeo de mayor calidad en un smart­phone, que hará que tus recuerdos sean aún más inolvidables.\r\n\r\nUn sistema de cámara dual totalmente nuevo: Ahora puedes hacer fotos a tus anchas, literalmente. Gracias a la nueva cámara con ultra gran angular, la interfaz te muestra lo que hay fuera del encuadre y te permite incluso fotografiarlo. Además, grabar y editar vídeos pasa a ser igual de fácil que con las fotos. La cámara más popular del mundo vuelve con una nueva y espectacular perspectiva.\r\n\r\nEl vidrio más duro: El vidrio de la parte delantera y trasera se ha reforzado mediante un proceso de doble intercambio iónico.\r\n\r\nResistente al agua hasta el doble de profundidad: El iPhone 11 es resistente al agua hasta 2 metros de profundidad durante un máximo de 30 minutos, el doble que el iPhone XR.\r\n\r\nEl iPhone estrena tecnología de banda ultraancha. El nuevo chip U1 de Apple utiliza esta tecnología para la detección espacial, lo cual permite al iPhone 11 localizar con precisión otros dispositivos Apple que también tengan chip U1. Es como un GPS, pero en tu salón. Así, cuando necesites compartir un archivo con AirDrop, solo tienes que apuntar a una persona y el iPhone sabrá exactamente a quién se lo\r\nCaracterísticas principales\r\nPantalla: 6.1\", 828 x 1792 pixels\r\nProcesador: Apple A13 Bionic\r\nRAM: 4GB\r\nAlmacenamiento: 64GB/128GB/256GB\r\nExpansión: sin microSD\r\nCámara: Dual, 12MP+12MP\r\nBatería: 3046 mAh\r\nOS: iOS 13\r\nPerfil: 8.3 mm\r\nPeso: 194 g\r\nPrecio: ~ 699 USD', 'apple-iphone-11-64gb-red.jpg', 'apple-iphone-11-64gb-redrear.jpg', 'side.png', 1, 2, 'ver. 13', 194, 'Procesador: Apple A13 Bionic', 21, 'https://www.smart-gsm.com/moviles/apple-iphone-11'),
('HW-PS234SMARTPRO', 'Huawei P Smart Pro', 'Toda la información comercial y técnica del gama media Huawei P Smart Pro a través de una ficha técnica que incluye listado de características, detalles de especificaciones, fotos, vídeo y precio. Este smartphone se caracteriza por su pantalla de 6.59 pulgadas y su cámara trasera con triple sensor de 48 MP + 8 MP + 2 MP.', 'HUAWEI P30 PRO\r\nDIMENSIONES Y PESO	158 x 73,4 x 8,4 milímetros, 192 gramos\r\nPANTALLA	OLED 6,47 pulgadas curved OLED\r\nPROCESADOR	Kirin 980\r\nMEMORIA RAM	8 GB\r\nALMACENAMIENTO	128/256/512 GB\r\nSISTEMA OPERATIVO	Android 9 Pie + EMUI\r\nCÁMARAS TRASERAS	40 MP (f/1.8) +\r\n20 MP (f/2.2, ultra gran angular) +\r\n8 MP (f/3.4, zoom 5x, OIS)\r\nCÁMARA FRONTAL	32 MP (f/2.0)\r\nBATERÍA	4.200 mAh + Carga rápida hasta 40 vatios + Carga inalámbrica 15 vatios + carga inversa\r\nCONECTIVIDAD	LTE Cat. 21, hasta 1,4 Gbps, Wi-Fi 802.11 a/b/g/n/ac, dual-band, WiFi Direct, hotspot, BT 5.0, NFC\r\nOTROS	USB tipo C 3.1, lector de huellas en pantalla\r\nCOLORES	Pearl white (blanco), Breathing Crystal (azul), Black (negro), Amber Sunrise (naranja-rojo), Aurora (azul-verde) (disponibilidad según mercados)\r\nPRECIO	Desde 999 euros En Amazon', 'huawei-p-smart-pro-emui-9.1-pc.png', 'resource_357450.jpg', 'size-image.jpg', 3, 1, '9 Pie', 206, 'Kirin 710F 4 (8 núcleo', 21, 'https://www.xatakamovil.com/huawei/huawei-p-smart-pro-caracteristicas-ficha-tecnica-precio'),
('SM-A505FZKSPHE', 'Galaxy A50', '6,4 pulgadas de la pantalla Infinity-U del Galaxy A50. Una pantalla de extremo a extremo con marco casi inexistente. Adéntrate aún más en tus videos y streamings favoritos con su resolución FHD+ y color Super AMOLED.', 'Galaxy A50 tiene un diseño premium auténtico. Elige entre el blanco y el negro más moderno o el brillo de los tonos coral y azul; su estilizado diseño se adapta cómodamente a tu mano. Su parte trasera de aspecto cristal y el sensor de huella dactilar en la pantalla ofrecen una superficie uniforme.', 'es-galaxy-a50-sm-a505fzksphe-frontblack-152257742.webp', 'es-galaxy-a50-sm-a505fzksphe-backblack-152257728.webp', 'es-galaxy-a50-sm-a505fzksphe-lsideblack-152257731.webp', 2, 1, 'ver. 9.9', 166, 'Kirin 710F 4 (8 núcleos (4x Cortex-A73 a 2.2GHz + 4x Cortex-A53 a 1.7GHz))', 21, 'https://www.cnet.com/es/noticias/caracteristicas-galaxy-a50-precio-celular-samsung-lector-sensor-pantalla/'),
('UNG-5743-GAL', 'Galaxi 52', 'cdsacdsa', 'sca', 'csa', '', 'side.png', 2, 1, 'ver. 1.0', NULL, NULL, 21, ''),
('UNG-9071-GAL', 'Galaxy A51', 'La pantalla Infinity-O de A51 logra optimizar la simetría visual. Ahora puedes jugar, visualizar contenido, navegar y realizar múltiples tareas sin interrupción en una pantalla panorámica FHD + de 6.5\", todo con tecnología Super AMOLED. Disfruta de una experiencia de smartphone que minimiza los marcos y maximiza cada pulgada de espacio en la pantalla.', 'Disfruta la alta resolución con una cámara principal de 48MP para fotos nítidas y claras tanto de día como de noche. Una cámara ultra gran angular de 123 ° y 12MP para que captures más y mejor. Elige la cámara macro mejorada de 5MP para primeros planos increíbles, y asegúrate de destacar siempre con los múltiples efectos Live Focus de la cámara de profundidad de 5MP.\r\n\r\n* La disponibilidad de color puede variar según el país o el operador\r\n\r\n Una asombrosa cuádruple cámara para captar mucho más \r\nCaptura más sin esfuerzo\r\nCaptura mucho más de tu mundo con el campo de visión más amplio de la cámara Ultra gran angular. Sin olvidar que con la cámara principal de 48MP podrás captar tus mejores momentos a lo largo del día.\r\n\r\n\r\nㅤ\r\nGran angular\r\n \r\nㅤ\r\nUltra gran angular\r\nㅤ\r\nㅤ\r\n* Imágenes simuladas con fines ilustrativos. ** La experiencia ultra gran angular (foto / video) es compatible solo con la cámara trasera .\r\nCámara Macro para capturar los detalles más de cerca\r\nLa cámara macro integrada Quad Cam de 5MP (40mm) captura con claridad y calidad y ayuda a resaltar todos los detalles de tus primeros planos. Aplica y ajusta el desenfoque de fondo natural (Bokeh) para aislar al sujeto y aumentar el impacto visual.\r\n\r\n* Imágenes simuladas con fines ilustrativos. ** La Macro Camera es compatible solo con la cámara trasera .\r\n\r\n Cámara Macro para capturar los detalles más de cerca \r\nHaz fotografías como un profesional\r\nGalaxy A51 graba como una cámara de acción profesional utilizando la cámara ultra gran angular y el software predictivo. Con Super steady puedes retransmitir vídeos en directo de tus mayores aventuras.\r\n', NULL, '', 'side.png', 2, 1, 'ver. 1.0', NULL, NULL, 21, '');
