(32, 17, 3, 13, 'UNG-9071-GAL', 'Galaxy A51', 'La pantalla Infinity-O de A51 logra optimizar la simetría visual. Ahora puedes jugar, visualizar contenido, navegar y realizar múltiples tareas sin interrupción en una pantalla panorámica FHD + de 6.5\", todo con tecnología Super AMOLED. Disfruta de una experiencia de smartphone que minimiza los marcos y maximiza cada pulgada de espacio en la pantalla.', 'Disfruta la alta resolución con una cámara principal de 48MP para fotos nítidas y claras tanto de día como de noche. Una cámara ultra gran angular de 123 ° y 12MP para que captures más y mejor. Elige la cámara macro mejorada de 5MP para primeros planos increíbles, y asegúrate de destacar siempre con los múltiples efectos Live Focus de la cámara de profundidad de 5MP.\r\n\r\n* La disponibilidad de color puede variar según el país o el operador\r\n\r\n Una asombrosa cuádruple cámara para captar mucho más \r\nCaptura más sin esfuerzo\r\nCaptura mucho más de tu mundo con el campo de visión más amplio de la cámara Ultra gran angular. Sin olvidar que con la cámara principal de 48MP podrás captar tus mejores momentos a lo largo del día.\r\n\r\n\r\nㅤ\r\nGran angular\r\n \r\nㅤ\r\nUltra gran angular\r\nㅤ\r\nㅤ\r\n* Imágenes simuladas con fines ilustrativos. ** La experiencia ultra gran angular (foto / video) es compatible solo con la cámara trasera .\r\nCámara Macro para capturar los detalles más de cerca\r\nLa cámara macro integrada Quad Cam de 5MP (40mm) captura con claridad y calidad y ayuda a resaltar todos los detalles de tus primeros planos. Aplica y ajusta el desenfoque de fondo natural (Bokeh) para aislar al sujeto y aumentar el impacto visual.\r\n\r\n* Imágenes simuladas con fines ilustrativos. ** La Macro Camera es compatible solo con la cámara trasera .\r\n\r\n Cámara Macro para capturar los detalles más de cerca \r\nHaz fotografías como un profesional\r\nGalaxy A51 graba como una cámara de acción profesional utilizando la cámara ultra gran angular y el software predictivo. Con Super steady puedes retransmitir vídeos en directo de tus mayores aventuras.\r\n', 'Memoria RAM 8 GB', '128G', 'Amarillo', '2020-07-12 16:15:25', 150, 2, 0, 1, 1),
(33, 18, 3, 14, 'UNG-9071-GAL', 'Galaxy A51', 'La pantalla Infinity-O de A51 logra optimizar la s...', 'Disfruta la alta resolución con una cámara princip...', 'Memoria RAM 8 GB', '128G', 'Lila', '2020-07-12 16:45:43', 150, 1, 0, 1, 1),
(34, 18, 3, 15, 'UNG-9071-GAL', 'Galaxy A51', 'La pantalla Infinity-O de A51 logra optimizar la s...', 'Disfruta la alta resolución con una cámara princip...', 'Memoria RAM 8 GB', '128G', 'Violeta', '2020-07-12 16:54:38', 141.75, 1, 0, 1, 1);
